
$(function(){
    let base64 = ['data:image/png;base64,', 'data:image/png;base64,', 'data:image/png;base64,', 'data:image/png;base64,'];
    function readInputFile(e){
        var sel_files = [];
        
        sel_files = [];
        
        var files = e.target.files;
        var fileArr = Array.prototype.slice.call(files);
        
        fileArr.forEach(function(f){
            if(files.length < 2){
                sel_files.push(f);
                var reader = new FileReader();
                reader.onload = function(e){
                    //var html = `<a id=img_id_${index}><img src=${e.target.result} data-file=${f.name} /></a>`;
                    $('img#profile').attr('src', e.target.result);
                };
                reader.readAsDataURL(f);
            }
        })
        if(files.length > 2){
            $('img#profile').css('box-shadow', 'box-shadow: 0rem 0rem 0.8rem 0rem #ff0088');
        }
    }
    
    document.querySelector('img#profile').addEventListener('click',()=>{
        document.querySelector('input#profile').click();
        $('input#profile').on('change', readInputFile);
    });

    $(document).ready(function(){
        $('img#profile').attr('src', base64[Math.floor(Math.random() * 3)]);
    });
});
